impl Solution {
    pub fn min_sum(nums1: Vec<i32>, nums2: Vec<i32>) -> i64 {
        let sum1: i64 = nums1.iter().map(|&x| x as i64).sum();
        let sum2: i64 = nums2.iter().map(|&x| x as i64).sum();
        let zeros1 = nums1.iter().filter(|&&x| x == 0).count() as i64;
        let zeros2 = nums2.iter().filter(|&&x| x == 0).count() as i64;

        if sum1 == sum2 {
            return sum1;
        }

        let diff = (sum1 - sum2).abs();
        if (zeros1 == 0 && sum1 < sum2) || (zeros2 == 0 && sum2 < sum1) {
            return -1;
        }

        let total_zeros = zeros1 + zeros2;
        if diff % total_zeros == 0 {
            sum1.max(sum2) + diff
        } else {
            -1
        }
    }
}
